import React from 'react';
import picture from '../../images/climb.jpeg'

import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'vh-100 center mt5' id = {id}>
                <div className = 'border-height'>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-50 center'>
                    </div>
                        <div className = 'mt3 mr3 ml3 br3 shadow-5 b--dark-gray scroll'>
                            <div className = 'vh-75 outer fl flex items-center'>
                                <div className = 'portraitPhoto'>
                                    <img src = {picture}
                                         className="br3 ba b--black-10 img"
                                         alt = ''/>
                                </div>
                            </div>
                        </div>
                </div>
            </div>
 );
}

export default AboutMe;
